type ElectionObjPushCallback struct {
	Cb ElectionObjKsfCallback
}

func (cb *ElectionObjPushCallback) Ondispatch(ksfResp *requestf.ResponsePacket) {
	switch ksfResp.SResultDesc {
	case "ElectionUpdate":
		err := func() error {
			var (
				length int32
				have   bool
				ty     byte
			)
			var err error
			readBuf := codec.NewReader(tools.Int8ToByte(ksfResp.SBuffer))
			var mark LeaderMark

			err = mark.ReadBlock(readBuf, 1, true)
			if err != nil {
				return err
			}

			_ = length
			_ = have
			_ = ty
			if ksfResp.Context != nil {
				cb.Cb.ElectionUpdate_Callback(&mark, ksfResp.Context)
				return nil
			} else {
				cb.Cb.ElectionUpdate_Callback(&mark)
				return nil
			}
		}()
		if err != nil {
			cb.Cb.ElectionUpdate_ExceptionCallback(err)
		}
	case "LaunchElection":
		err := func() error {
			var (
				length int32
				have   bool
				ty     byte
			)
			var err error
			readBuf := codec.NewReader(tools.Int8ToByte(ksfResp.SBuffer))
			var rsp LaunchElectionRsp

			err = rsp.ReadBlock(readBuf, 2, true)
			if err != nil {
				return err
			}

			_ = length
			_ = have
			_ = ty
			if ksfResp.Context != nil {
				cb.Cb.LaunchElection_Callback(&rsp, ksfResp.Context)
				return nil
			} else {
				cb.Cb.LaunchElection_Callback(&rsp)
				return nil
			}
		}()
		if err != nil {
			cb.Cb.LaunchElection_ExceptionCallback(err)
		}
	}
}
